import { Outlet, NavLink } from "react-router-dom";

export default function HostLayout() {
  return (
   <div>
      <header className="host-header">
        <nav className="host-navbar">
          <NavLink to='/host' className="dashboard-NavLink">DashBoard</NavLink>
          <NavLink to='/host/income' className="income-NavLink">Income</NavLink>
          <NavLink to='/host/reviews' className="reviews-NavLink">Reviews</NavLink>
        </nav>
      </header>
      <Outlet />
   </div>
  );
};
